import React from 'react';
import ReactDOM from 'react-dom';
import './styles.css';
import Formulario from './Formulario';

ReactDOM.render(
	<React.StrictMode>
		<div className="container">
            <div className="row">
                <div className="col-sm-3"></div>
                <div className="col-sm-6">
                    <Formulario />
                </div>
                <div className="col-sm-3"></div>
            </div>

		</div>
	</React.StrictMode>,
	document.getElementById('root')
);
